import React from 'react';
import './App.css';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Welcome to Brutten Nete</h1>
                <p>Your new React application is ready!</p>
            </header>
        </div>
    );
}

export default App;
